import random #provides functions for generating random numbers
import string #provides a collection of string-related constants and functions
import matplotlib.pyplot as plt #imports pyplot module that is used for creating plots and charts.

"""The class "HangmanGA" defines all the necassary functions used in a genetic algorithm that will be required to find a solution for the Hangman game. The algorithm evolves a population of guesses over generations, using selection, crossover, and mutation operations to improve the quality of the guesses and converge towards the correct solution."""

class HangmanGA:
    def __init__(self, word_to_guess, population_size): #the class constructor with the 2 parameters
        self.word_to_guess = word_to_guess #sets the word that is to be guessed
        self.population_size = population_size #sets population size
        self.population = self.initialize_population() #initialize population using the initalize_population function
        self.fitness_history = [] #initialze an array for fitness history to save all the fitness functions
        self.correct_guesses_percentage_history = [] #initialze an array to save all the guesses percentage

    def initialize_population(self): #generates initial population of the guesses
        return [[random.choice(string.ascii_lowercase) for _ in range(len(self.word_to_guess))] #loop runs for each individual in the population and creates a list of characters with a length equal to the number of characters in the target word
                for _ in range(self.population_size)] #loop runs the number of population time

    def calculate_fitness(self, individual_guess): #determinines the fitness of an individual guess by counting the number of correct guesses
        correct_guesses = sum(1 for i, c in enumerate(self.word_to_guess) if c == individual_guess[i]) #for every correct letter, it adds 1 in the correct_guess
        return correct_guesses

    def select_parents(self): #performs tournament selection to choose parents from the current population based on their fitness.
        tournament_size = min(3, self.population_size) #sets the minimum population size between 3 and total population size.
        selected_parents = [] #empty array for the selected parents

        for _ in range(self.population_size): #loop iterates over the entire population size
            tournament = random.sample(self.population, tournament_size) # creates a tournament by randomly sampling tournament_size individuals from the current population without replacement.
            tournament_fitness = [self.calculate_fitness(individual) for individual in tournament] #calculates the fitness of each individual in the tournament using the calculate_fitness method.
            selected_parents.append(tournament[tournament_fitness.index(max(tournament_fitness))]) #selects the parent with the maximum fitness from the tournament and adds it to the list of selected parents

        return selected_parents

    def crossover(self, parent1, parent2, crossover_probability=0.8): #performs crossover between two parents to produce two children.
        if random.random() < crossover_probability: #checks whether the random value is less than the given crossover probability, if it is then crossover will take place.
            crossover_point = random.randint(1, len(self.word_to_guess) - 1) #determines the crossover point, which is a random index between 1 and the length of the target word minus 1
            child1 = parent1[:crossover_point] + parent2[crossover_point:] #creates the first child by combining the genes from parent1 up to the crossover point with the genes from parent2 after the crossover point
            child2 = parent2[:crossover_point] + parent1[crossover_point:] #creates the second child by combining the genes from parent2 up to the crossover point with the genes from parent1 after the crossover point.
            return child1, child2
        else: #if crossover doesn't happen it returns the original parents
            return parent1, parent2

    def mutate(self, individual, mutation_probability=0.03): #introduces mutations to an individual's genes with a certain probability.
        mutated_individual = [] #initializes an empty list to store the mutated genes of the individual.
        for gene in individual: #iterates over each gene in the original individual.
            if random.random() < mutation_probability: #checks If the random value is less than the given mutation probability, if yes then a mutation will take place for the current gene.
                mutated_individual.append(random.choice(string.ascii_lowercase)) # a random lowercase letter is chosen and added to the mutated individual instead of the original gene.
            else: #if no mutation occurs, the original gene is added to the mutated individual.
                mutated_individual.append(gene)
        return mutated_individual

    def evolve(self, generation): #evolves the population to the next generation
        new_population = [] #initializes an empty list to store the new population that will be generated in the current generation.
        parents = self.select_parents() #selects parents using the select_parents method, which implements tournament selection.

        for i in range(0, self.population_size, 2): #iterates through the parents, creating two children in each iteration.
            parent1, parent2 = parents[i], parents[i + 1] #assigns two consecutive parents from the selected parents list to parent1 and parent2.
            child1, child2 = self.crossover(parent1, parent2) #line performs crossover between parent1 and parent2 to generate two children.
            child1 = self.mutate(child1) #applies mutation to child1.
            child2 = self.mutate(child2) #applies mutation to child2.
            new_population.extend([child1, child2]) #children are added to the new population.

        self.population = new_population

        #statistics for the current generation are calculated
        best_agent = max(self.population, key=self.calculate_fitness) #the child with the maximum fitness is selected as best_Agent
        best_fitness = self.calculate_fitness(best_agent) #best_agent's fitness is set as best_sitness
        self.fitness_history.append(best_fitness) #best_fitness is added to the fitness history array

        correct_guesses_percentage = (best_fitness / len(self.word_to_guess)) * 100 #percentage is calculated for correct guess
        self.correct_guesses_percentage_history.append(correct_guesses_percentage) #added to percenatge history

        #print statistics for the current generation
        print(f"\nGeneration {generation + 1}, Best Agent: {''.join(best_agent)}, Fitness: {best_fitness}")
        print(f"Correct Guesses Percentage: {correct_guesses_percentage:.2f}%")

""" The function simulates a step in the Hangman game by comparing the individual's guess with the target word. It updates the Hangman state based on correct guesses and increments the count of incorrect guesses. The updated Hangman state and the number of incorrect guesses are then returned"""

def play_hangman(word_to_guess, individual_guess): #simulates the Hangman game by comparing the individual's guess with the target word and updating the Hangman state accordingly.
    incorrect_guesses = 0 #Initializes a counter to keep track of the number of incorrect guesses.
    hangman_state = ['_'] * len(word_to_guess) #initializes the Hangman state as a list of underscores (_) with the same length as the target word

    for i, char in enumerate(word_to_guess): #iterates through each character in the target word
        if char == individual_guess[i]: #checks if the corresponding character in the individual's guess matches the target word.
            hangman_state[i] = char # updates the Hangman state at position i with the correct letter.
        else:
            incorrect_guesses += 1 #increments the incorrect guesses counter.

    return hangman_state, incorrect_guesses

"""The plot_statistics function uses the matplotlib library to create a subplot with two plots: one for the evolution of the best fitness over generations and another for the evolution of the correct guesses percentage over generations"""

def plot_statistics(fitness_history, correct_guesses_percentage_history): #plots the evolution of best fitness and correct guesses percentage over generations in a genetic algorithm
    generations = range(1, len(fitness_history) + 1) #creates a range of generation numbers based on the length of the fitness history.

    plt.figure(figsize=(10, 5)) #initializes a new figure with a specified size (width=10, height=5).

    plt.subplot(1, 2, 1) #creates a subplot with 1 row, 2 columns, and selects the first subplot.
    plt.plot(generations, fitness_history, marker='o')
    plt.title('Evolution of Best Fitness Over Generations')
    plt.xlabel('Generation')
    plt.ylabel('Best Fitness')

    plt.subplot(1, 2, 2) #creates a subplot with 1 row, 2 columns, and selects the second subplot.
    plt.plot(generations, correct_guesses_percentage_history, marker='o', color='green')
    plt.title('Evolution of Correct Guesses Percentage Over Generations')
    plt.xlabel('Generation')
    plt.ylabel('Correct Guesses Percentage (%)')

    plt.tight_layout() #adjusts the layout to prevent overlapping between subplots.
    plt.show()

"""The main function serves as the entry point for your Hangman genetic algorithm program."""

def main(): #main function
    hangman_word = input(str("Enter the target word: ")) #target word
    population_size = 100 #population size initially set to 100
    #initializes an instance of the HangmanGA class with the target word and population size.
    hangman_genetic_algorithm = HangmanGA(hangman_word, population_size)

    while True: #keeps running until user presses 3
        print("\nMenu:")
        print("1. Evolve for a Generation")
        print("2. Plot Statistics")
        print("3. Exit")

        choice = input("Enter your choice: ")

        if choice == '1': #play Hangman with the best agent for demonstration
            hangman_genetic_algorithm.evolve(len(hangman_genetic_algorithm.fitness_history))
            best_agent_guess = ''.join(max(hangman_genetic_algorithm.population, key=hangman_genetic_algorithm.calculate_fitness))
            hangman_state, incorrect_guesses = play_hangman(hangman_word, best_agent_guess)
            print(f"Hangman Word: {hangman_word}")
            print(f"Best Agent's Guess: {best_agent_guess}")
            print(f"Current Hangman State: {' '.join(hangman_state)}")
            print(f"Incorrect Guesses: {incorrect_guesses}/{len(hangman_word)}")

        elif choice == '2': #the statistics are plotted using the plot_statistics function
            plot_statistics(hangman_genetic_algorithm.fitness_history, hangman_genetic_algorithm.correct_guesses_percentage_history)

        elif choice == '3':
            break

        else:
            print("Invalid choice. Please enter a valid option.")

if __name__ == "__main__": #used to run the main program
    main()

